import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <div className="parallax-wrapper">
        <div className="App">
          <header className="App-header">
            {/* top section goes here - name, intro and link to contact me and download resume */}
          </header>
          <main className="mainBody">{/* components including  */}</main>
          <footer className="footer"></footer>
        </div>
      </div>
    </div>
  );
}

export default App;
